import * as actionTypes from './actionTypes'

const authStart = () => {
    return {
        type: actionTypes.AUTH_START,
    }
}

const authSuccess = (data) => {
    return {
        type: actionTypes.authSuccess,
        authData: data,
    }
}

const authFail = () => {
    return {
        type: actionTypes.AUTH_FAIL,
    }
}

export const auth = (username, password) => {
    return (dispatch) => {
        dispatch(authStart)
    }
}
